            this.textBox1.Text = "1:수전보조의 진화는 경공이동.특수효과 2입력.\r\n\r\n2:비상이동은 돌격이동과 이동력절약 효과를 겸함.\r\n\r\n3:MP방어는 MP회복의 효과를 겸함" +
    ".\r\n\r\n4:MP방어의 경우 AI가 MP방어가 있는 부대를 제대로 인식하지 못하여 이로 인해 MP회복이 가능함에도 조언을 남발하는 경우가 발생한" +
    "다. 그러므로 현재 MP방어에 딸려있는 MP회복은 끄는 것을 권장.\r\n";
